import React, { Component } from "react";
import { Container, Button } from "react-bootstrap";

class Primitiva extends Component {
  constructor(props) {
    super(props);
    // this._service = new EuroService();
    this.state = {};
  }
  render() {
    return (
      <Container>
        <section>
          <h1>Primitiva</h1>
        </section>

        <Button variant="dark" type="submit">
          1
        </Button>
        <Button variant="dark" type="submit">
         2
        </Button>
        <Button variant="dark" type="submit">
          3
        </Button>
        <Button variant="dark" type="submit">
          4
        </Button>
      </Container>
    );
  }
}

export default Primitiva;
